import React from 'react';
import '../App.css';


function Contact() {
    return(
        <main>
            <section className="col col-one">
                <h2>Want to get in touch?</h2>
                <h3>Send me an email...</h3>
                <p>sigridstensvold@gmail.com</p>

                <h3>...Or find me on these platforms</h3>
                <p>Github: @sigridstens</p>
                <p>Instagram: @sigridstensvold</p>
            </section>

            <figure className="col col-two">
                <img src={process.env.PUBLIC_URL + '/images/sigrid.jpg'} className="biopic" alt="Sigrid's profile" />
            </figure>
        </main>
    )
}

export default Contact;
